import React from 'react';
import "./Home.css";

const Home = () => {
  return (
    <div className="Home">
      <h1>Bienvenidos a la web del arte</h1>
      <p>Para poder acceder a los contenidos tenéis que logaros en la página. Si todavía no tenéis un usuario también podéis registraros clicando en Regi.</p>
    </div>
  )
}

export default Home;
